using DeltaFestival.Models;
using Entities;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace DeltaFestivalAPI.Transverse
{
    public class Bouchons
    {
        //Mood
        public List<Mood> GetAllBouchonMood()
        {
            List<Mood> moods = new List<Mood>();
            for (int i = 0; i < 30; i++)
            {
                Mood m = new Mood();
                m.Id = i;
                //m. = "Mood  N°" + i;
                moods.Add(m);
            }

            return moods;
        }

        public List<Role> GetAllBouchonRole()
        {
            List<Role> roles = new List<Role>();
            for (int i = 0; i < 5; i++)
            {
                Role r = new Role();
                r.Id = i;
                r.Label = "Role N°" + i;
            }

            return roles;
        }

        public List<User> GetAllBouchonUser()
        {
            List<User> users = new List<User>();
            for (int i = 0; i < 50; i++)
            {
                User u = new User();
                u.Id = i;
                u.MoodId = 5;
                u.UserRoleId = 1;
                u.TicketCode = "TicketCode" + i;
                users.Add(u);
            }
            return users;
        }

        //Publication
        public List<Publication> GetAllBouchonPublication()
        {
            List<Publication> pubs = new List<Publication>();
            for (int i = 0; i < 30; i++)
            {
                Publication p = new Publication();
                p.Id = i;
                p.Date = DateTime.Now;
                p.File = "";
                p.Hashtag = "#LaDeguste " + i;
                p.Content= "Publication N°" + i;
                p.UserId = i;
                pubs.Add(p);
            }

            return pubs;
        }

        //User
    }
}
